                       let isMobile = window.matchMedia('only screen and (max-width: 1023px)').matches;
                       if (!isMobile) {
                         if (maxheight >= minheight) {
                           $('.price_container_cal').attr(
                             'style',
                             'display: flex; flex-flow: column; justify-content: flex-end; height:' + maxheight + 'px;'
                           );
                         }
                       }
                     }, 500);
                   }
                 });
               });
